import{_ as e,c as t,o as i,ab as a}from"./chunks/framework.CUflZczI.js";const p=JSON.parse('{"title":"WiFi 数传电台","description":"","frontmatter":{},"headers":[],"relativePath":"zh/telemetry/telemetry_wifi.md","filePath":"zh/telemetry/telemetry_wifi.md"}'),r={name:"zh/telemetry/telemetry_wifi.md"},o=a('<h1 id="wifi-数传电台" tabindex="-1">WiFi 数传电台 <a class="header-anchor" href="#wifi-数传电台" aria-label="Permalink to &quot;WiFi 数传电台&quot;">​</a></h1><p>WiFi telemetry enables MAVLink communication between a WiFi radio on a vehicle and a GCS.<br> WiFi typically offers shorter range than a normal telemetry radio, but supports higher data rates, and makes it easier to support FPV/video feeds. Usually only a single radio unit for the vehicle is needed (assuming the ground station already has WiFi).</p><p>PX4 supports telemetry via UDP and Wifi. It broadcasts a heartbeat to port 14550 on 255.255.255.255 until it receives the first heartbeat from a ground control station, at which point it will only send data to this ground control station.</p><p>兼容的 WiFi 数传模块有：</p><ul><li><a href="./../telemetry/esp8266_wifi_module.html">ESP8266 WiFi 模块</a></li><li><a href="./../telemetry/esp32_wifi_module.html">ESP32 WiFi Module</a></li><li><a href="./../telemetry/3dr_telemetry_wifi.html">3DR Telemetry Wifi</a> (Discontinued)</li></ul>',5),l=[o];function n(s,d,_,m,h,c){return i(),t("div",null,l)}const u=e(r,[["render",n]]);export{p as __pageData,u as default};
